import React from 'react'
import Greenbtn from './Greenbtn';
import { GoThreeBars } from "react-icons/go";
import {  FaTimes } from "react-icons/fa";
import { SiTwitch, SiLinkedin, SiFacebook } from "react-icons/si";
import { useState } from 'react';

const Navbar = () => {

  const [navigation, setNavigation] = useState(false);

  const links = [
    {
      id: 1,
      link: 'home',
    },
    {
      id: 2,
      link: 'services',
    },
    {
      id: 3,
      link: 'about',
    },
    {
      id: 4,
      link: 'support',
    },
    {
      id: 5,
      link: 'pricing',
    },

  ]
  return (
    <div className='w-screen h-20 z-20 fixed bg-gray-900 text-white'>
      <div className='px-3 flex items-center justify-between w-full h-full'>
        <div className='flex items-center'>
          <h1 className='text-4xl font-bold'>onnn</h1>
        </div>
        <ul className=' hidden md:flex'>
          {links.map(({id, link})=> (
            <li key={id} className='capitalize p-4 cursor-pointer hover:text-lightcolor duration-200 '>
              {link}
            </li>
          ))}
        </ul>
        <div className='hidden md:flex mr-4'>
          <Greenbtn title='sign in' className='px-9 py-3'/>
        </div>
        {/*Burger icon*/}
        <div className='md:hidden'>
          <div className='cursor-pointer'>
            <GoThreeBars size={30}/>
          </div>
        </div>
        {/*Mobile menu*/}
        <div className={ navigation ? 'md:hidden fixed left-0 top-0 w-full h-full bg-gray-900/70 backdrop-blur' : ''}>
          <div className='fixed left-0 top-0 w-4/5 h-full bg-gray-900 text-white p-10 ease-in duration-300'>
            <div>
              <div className='flex w-full items-center justify-between'>
              <h2 className='text-3xl font-bold capitalize cursor-pointer'>
                onnn
              </h2>
              <div  className='p-3 cursor-pointer'>
                <FaTimes size={30}/>
              </div>
              </div>
            
          
            </div>
          </div>
        </div>

      </div>
    </div>
  )
}

export default Navbar
